/****************************** APERIODIC THREADS **********************************/

/************************************************************************************
 * Name: aperiodic_muphone_demo_screen
 * Purpose: Aperiodic event created after the initial display of the intro screen
 *          screen upon MuPhone boot-up. If a valid touch was made to the LCD TouchPanel,
 *          a thread for checking what section of the screen was pressed will be
 *          created.
 * Input(s): N/A
 * Output: N/A
 ***********************************************************************************/
void aperiodic_muphone_demo_screen(void)
{
    uint8_t status;     // used to identify which P4 pin triggered the ISR (pins 4 or 5)

    status = P4IV;      // P4IV = (2*(n+1)) where n is the pin number of the
                        // lowest bit with a pending interrupt.
                        // this access will only clear flag n.

    // if LCD TP triggered interrupt (port 4, pin 0)
    if (status == 2)        //  2 = 2*(0+2)
    {
        // disable pin 0 interrupt (will be rearmed after 0.5 seconds) (IMPLEMENT!)
        GPIO_disableInterrupt(GPIO_PORT_P4, GPIO_PIN0);

        // create thread to check LCD screen press within Compose Message
        G8RTOS_add_thread(thread_muphone_demo_screen_check_TP, 50, "TP - demo screen");
    }
}

/************************************************************************************
 * Name: aperiodic_muphone_home_button
 * Purpose: Aperiodic event to register home button push (bottom daughter board button)
 * Input(s): N/A
 * Output: N/A
 ***********************************************************************************/
void aperiodic_muphone_home_button(void)
{
    uint8_t status;     // used to identify which P5 pin triggered the ISR (pin 4)

    status = P5IV;      // P4IV = (2*(n+1)) where n is the pin number of the
                        // lowest bit with a pending interrupt.
                        // this access will only clear flag n.

    // if down push-button triggered interrupt
    if (status == 10)       // 10 = 2*(4+1)
    {
        // disable pin 0 interrupt (will be rearmed after 0.5 seconds) (IMPLEMENT!)
        GPIO_disableInterrupt(GPIO_PORT_P5, GPIO_PIN4);

        // create thread to check LCD screen press within Compose Message
        G8RTOS_add_thread(thread_muphone_home_button_check, 50, "TP - home screen");
    }
}

/************************************************************************************
 * Name: aperiodic_muphone_home_screen
 * Purpose: Aperiodic event created after the initial display of the Compose Message
 *          screen within MuMessage. If a valid touch was made to the LCD TouchPanel,
 *          a thread for checking what section of the screen was pressed will be
 *          created.
 * Input(s): N/A
 * Output: N/A
 ***********************************************************************************/
void aperiodic_muphone_home_screen(void)
{
    uint8_t status;     // used to identify which P4 pin triggered the ISR (pins 4 or 5)

    status = P4IV;      // P4IV = (2*(n+1)) where n is the pin number of the
                        // lowest bit with a pending interrupt.
                        // this access will only clear flag n.

    // if LCD TP triggered interrupt (port 4, pin 0)
    if (status == 2)        //  2 = 2*(0+2)
    {
        // disable pin 0 interrupt (will be rearmed after 0.5 seconds) (IMPLEMENT!)
        GPIO_disableInterrupt(GPIO_PORT_P4, GPIO_PIN0);

        // create thread to check LCD screen press within Compose Message
        G8RTOS_add_thread(thread_muphone_home_screen_check_TP, 50, "TP - home screen");
    }
}

/************************** END OF APERIODIC THREADS *******************************/


/******************************* COMMON THREADS ************************************/

/************************************************************************************
* Name: thread_muphone_demo_screen_check_TP
* Purpose: Thread to check if touch made to LCD TouchPanel interacted with any
*          predefined sections on the demo screen of the MuPhone.
* Input(s): N/A
* Output: N/A
************************************************************************************/
void thread_muphone_demo_screen_check_TP(void)
{
    // first debounce LCD
    G8RTOS_thread_sleep(TWO_TENTHS_SECOND_MS);

    // check if triggering switch is high after debounce time
    if ( P4->IN & PIN_TOUCHPANEL )
    {
         G8RTOS_kill_current_thread();     // thread improperly called
    }

    // otherwise, touch was properly made to TouchPanel LCD
    Point touch = TP_ReadXY();

    // index used to check for interaction between specific sections of screen
    int index = -1;

    // check for touch made to home screen application icons
    index = TP_CheckForSectionPress(touch, section_muphone_demo_screen,
                                    (sizeof(section_muphone_demo_screen)/sizeof(section_muphone_demo_screen[0])));

    // if touch made to LCD screen interacted with demo screen buttons
    if (index != -1)
    {

        // if more than application icons on home screen, this will need to be moved
        G8RTOS_disable_aperiodic_thread(PORT4_IRQn);        // disable home screen aperiodic event

        if (index == BRIT_BUTTON_INDEX)
        {
            phone.self_contact = BRIT;
            phone.board_type = Host;
            G8RTOS_add_thread(thread_init_host_wifi, 30, "initHostWifi");
           // G8RTOS_add_thread(thread_receive_data, 60, "receiveData");
        }
        else if (index == CHRIS_BUTTON_INDEX)
        {
            phone.self_contact = CHRIS;
            phone.board_type = Client;
            G8RTOS_add_thread(thread_init_client_wifi, 30, "initClientWifi");
            //G8RTOS_add_thread(thread_receive_data, 60, "receiveData");
        }
        else
        {
            G8RTOS_thread_sleep(300);
        }

        // initialize necessary MuPhone system criteria
        G8RTOS_semaphore_init(&semaphore_CC3100, 1);

        G8RTOS_add_thread(thread_muphone_start_phone, 50, "muphone - start");

        // background processes to run always
        G8RTOS_add_thread(thread_mumessage_background_processes, 150, "mumessage - b.p.");

        // globally receive data, and then decide which application to send data to
    }
    else        // otherwise, allow future touches to be made to LCD TP
    {
        // re-enable LCD Touch Panel interrupt and clear interrupt flag
        GPIO_enableInterrupt(GPIO_PORT_P4, GPIO_PIN0);
        GPIO_clearInterruptFlag(GPIO_PORT_P4, GPIO_PIN0);
    }

    // done handling TP touches, kill self
    G8RTOS_kill_current_thread();

}

/************************************************************************************
* Name: thread_muphone_home_button_check
* Purpose: Thread to check if MuPhone home button was pressed
* Input(s): N/A
* Output: N/A
************************************************************************************/
void thread_muphone_home_button_check(void)
{

    // first debounce daughter board button
    G8RTOS_thread_sleep(20);

    // check if triggering switch is high after debounce time
    if ( !(P4->IN & PIN_HOME_BUTTON) )
    {
        // ISR was properly called

        // kill current application and display home screen
        // IMPLEMENT: KILL CURRENT APP

        kill_ballsy_threads();
        kill_mumessage_threads(); //kill them all
        /* display home screen */
        G8RTOS_add_thread(thread_muphone_home_screen, 50, "muphone - home screen");
    }

    // re-enable home button interrupt interrupt and clear interrupt flag
    GPIO_enableInterrupt(GPIO_PORT_P5, GPIO_PIN4);
    GPIO_clearInterruptFlag(GPIO_PORT_P5, GPIO_PIN4);

    // done handling TP touches, kill self
    G8RTOS_kill_current_thread();
}

/************************************************************************************
* Name: thread_muphone_home_screen_check_TP
* Purpose: Thread to check if touch made to LCD TouchPanel interacted with any
*          predefined sections on the home screen of the MuPhone.
* Input(s): N/A
* Output: N/A
************************************************************************************/
void thread_muphone_home_screen_check_TP(void)
{
    // first debounce LCD
    G8RTOS_thread_sleep(TWO_TENTHS_SECOND_MS);

    // check if triggering switch is high after debounce time
    if ( P4->IN & PIN_TOUCHPANEL )
    {
         G8RTOS_kill_current_thread();     // thread improperly called
    }

    // otherwise, touch was properly made to TouchPanel LCD
    Point touch = TP_ReadXY();

    // index used to check for interaction between specific sections of screen
    int index = -1;

    // check for touch made to home screen application icons
    index = TP_CheckForSectionPress(touch, section_muphone_home_screen_applications,
                                    (sizeof(section_muphone_home_screen_applications)/sizeof(section_muphone_home_screen_applications[0])));

    // if touch made to LCD screen interacted with home screen
    if (index != -1)
    {
        // touch interacted with application icons

        // if more than application icons on home screen, this will need to be moved
        G8RTOS_disable_aperiodic_thread(PORT4_IRQn);        // disable home screen aperiodic event

        // if pressed the MuMessage application icon
        if (index == MUMESSAGE_APP_ICON_INDEX)
        {
            // start MuMessage
            G8RTOS_add_thread(thread_mumessage_start_app, 110, "mumessage");
        }
        else if (index == BALLSY_APP_ICON_INDEX)
        {
            G8RTOS_add_thread(thread_ball_program_init, 50, "ballsy - start app");

            // IMPLEMENT: MAKE SURE TO KILL APERIODIC THREAD UPON GOING TO HOME SCREEN
        }
        else if (index == PONG_APP_ICON_INDEX)
        {
            //IMPLEMENT: PONG M8YYY
        }
    }
    else        // otherwise, allow future touches to be made to LCD TP
    {
        // re-enable LCD Touch Panel interrupt and clear interrupt flag
        GPIO_enableInterrupt(GPIO_PORT_P4, GPIO_PIN0);
        GPIO_clearInterruptFlag(GPIO_PORT_P4, GPIO_PIN0);
    }

    // done handling TP touches, kill self
    G8RTOS_kill_current_thread();

}

